species. It is a sister species with, </tspan><tspan x="0" y="32.4" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">and very closely related to, the white-crowned sparrow; studies of mitochondrial </tspan><tspan x="0" y="48.6" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">DNA show the two evolved into separate species very recently in geologic time. </tspan><tspan x="0" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">The white-throated sparrow is a slightly more distant relative. Hybridization with </tspan><tspan x="0" y="81" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">both white-crowned and white-throated sparrows has been reported.</tspan></text>	</g>	<rect x="37.4" y="55" display="inline" fill="none" width="458.9" height="37"/>			<text id="name" transform="matrix(1 0 0 1 79.6575 77.8237)" display="inline" fill="#603813" font-family="'TwCenMT-Regular'" font-size="36px">Golden-crowned Sparrow</text>	<rect x="119.7" y="545" display="inline" fill="none" width="294.3" height="28"/>			<text id="scientificName" transform="matrix(1 0 0 1 163.9729 562.0371)" display="inline" fill="#603813" font-family="'Parisienne-Regular'" font-size="26px">Zonotrichia atricapilla</text></g><g id="Descriptions" display="none">			<text id="graphName" transform="matrix(1 0 0 1 539.22 146.9308)" display="inline" fill="#603813" font-family="'TwCenMT-Bold'" font-size="26px">{{   chosenItemInfo[chosenItem].text   }}</text>	<g id="SpeciesNumberDescription" onload="v-show=chosenItem=='SpeciesNumber'" display="inline">		<rect x="654.6" y="578" fill="none" width="291.9" height="49.8"/>		<text transform="matrix(1 0 0 1 654.5771 585.6074)"><tspan x="0" y="0" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="12px">The sum of all observed individuals for the selected query </tspan><tspan x="0" y="12" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="12px">region and species. This is comp
